int main(int argc, char** argv)
{
  int nerr ;
  double k = 0.0 ;
  if (argc != 3)
    {
      printf("%s\n", "./run.exe in_params outfile") ;
      exit(1) ;
    }
  FILE* in = fopen(argv[1],"r") ;
  FILE* f_o = fopen(argv[2],"w") ;

  read_params(in) ;
  make_ks() ;
  
  nerr = Problem1(f_o) ;

  return(0);
}


static int Problem1(FILE* out)
{
  real ropt[OPT_SIZE], reltol=RTOL, abstol=ATOL, t, tout, ero, er;
  long int iopt[OPT_SIZE];
  int lmm, miter, flag, iter, iout, nerr=0;
  N_Vector y;
  void *cvode_mem;
  iopt[MAXORD] = 0 ;
  iopt[MXSTEP] = maxstep ;
  iopt[MXHNIL] = 0 ;
  ropt[H0] = 0.0 ;
  ropt[HMAX] = 0.0 ;
  ropt[HMIN] = 0.0 ;

  double outfrac = 0.0 ;

  int converge = 1 ;

  y = N_VNew(NEQ, NULL);
  N_VIth(y,0) = A0 ;
 N_VIth(y,2) = I0 ;
  N_VIth(y,1) = B0 ;

  cvode_mem = CVodeMalloc(NEQ, f, 0, y, BDF, NEWTON, ITOL,
			  &reltol, &abstol, NULL, ERRFP, OPTIN, iopt, ropt, NULL);
  if (cvode_mem == NULL) { printf("CVodeMalloc failed."); return(1); }
  CVDense(cvode_mem,NULL,NULL) ;

  for(iout=1, tout=tstart; iout <= nout; iout++, tout *= tfac) 
    {
      flag = CVode(cvode_mem, tout, y, &t, NORMAL);
      if (flag != SUCCESS) {
	nerr++;
	printf("\n\n CVode returned error flag = %d at time %g\n\n", flag,t);
	converge = 0 ;
	break;	
      }
      outfrac = (double)n*2.0*N_VIth(y, FULLIND)/A0 ;
      fprintf(out, "%g	%g\n", tout,outfrac) ;
    }
  CVodeFree(cvode_mem);
  N_VFree(y);
  return(nerr);
}


